Ponimaia eto, my staraemsia popolniat' nashikh pol'zovatelei samoi svezhei i aktual'noi informatsiei o proisshestviiakh v mire politiki. Dlia togo, daby operativno obnovliat' novosti politiki v mire, rabotaet tselaia obshchestvo opytnykh professionalov, kotorye v rezhime onlain otslezhivaiut informatsionnyi mnogo i otbiraiut samye vazhnye dannye, ne zabyvaia ispytyvat' ikh dlia dostovernost'. Perepechatka novostei iz drugikh istochnikov - eto ne pro nas, odnako materialy nashego saita unikal'ny i nepovtorimy.
