Soobrazno rezul'tatam EGE Grazhdane, poluchivshie udovletvoritel'nye rezul'taty gosudarstvennoi itogovoi attestatsii (EGE) soobrazno obrazovatel'noi programme srednego obshchego obrazovaniia (11 klassov shkoly), imeiut privilegiia na otsrochku cherez armii prezhde 1 oktiabria vozrast prokhozhdeniia ukazannoi attestatsii;
Esli Vy obuchaetes' soobrazno ochnoi forme obucheniia v obrazovatel'noi organizatsii soobrazno imeiushchei gosudarstvennuiu akkreditatsiiu programme srednego professional'nogo obrazovaniia (v tekhnikum tozh kolledzh), Vam predostaviat otsrochku ot armii dlia polnost'iu srok obucheniia; Ukazannaia ostanovka predostavliaetsia odin v sluchae, bude ranee Vy ne pol'zovalis' svoim pravom na otsrochku byt' obuchenii v shkole.
Kogda Vy obuchaetes' soobrazno ochnoi forme obucheniia v VUZe po imeiushchei gosudarstvennuiu akkreditatsiiu obrazovatel'noi programme i ranee ne pol'zovalis' svoim pravom dlia otsrochku (oprich' shkoly) okolo dostizhenii 18 let, Vam obiazany predostavit' otsrochku cherez armii na pogolovno srok obucheniia, no ne svyshe ustanovlennykh obrazovatel'nymi standartami srokov polucheniia vysshego obrazovaniia po programmam bakalavriata tozh spetsialiteta; Osnovnye usloviia radi predostavleniia otsrochki po obucheniiu v VUZe: pered zachisleniia v VUZ ne predostavlialas' ostanovka cherez armii soobrazno obucheniiu v kolledzhe (tekhnikume) ,  obrazovatel'naia spisok (zaniatie) VUZa imeet gosudarstvennuiu akkreditatsiiu ,  ochnaia model' obucheniia
Ezheli Vy oformili akademicheskii uvol'nenie vo epokha obucheniia i pri etom universal'nyi srok obucheniia uvelichivaetsia ne bolee chem na 1 god, sledovat' Vami sokhraniaetsia preimushchestvo dlia otsrochku cherez prizyva; Kogda Vy perevodites' s odnoi spetsial'nosti dlia druguiu v ramkakh odnoi obrazovatel'noi organizatsii, libo perevodites' v druguiu obrazovatel'nuiu organizatsiiu dlia obucheniia po obrazovatel'noi programme togo zhe urovnia obrazovaniia, byt' etom obshchii srok obucheniia ne uvelichivaetsia inache uvelichivaetsia ne bolee chem dlia odinokii god, za Vami sokhraniaetsia vlast' dlia otsrochku ot armii; Obratite zabota, chtoby vstupleniia otsrochki v silu, l'gota dlia otsrochku sleduet realizovat'. Bude zhe pervaia ostanovka byla predostavlena Vam s narusheniiami reglamenta, to sleduet razobrat' eto chistyi nerealizovannoe preimushchestvo na otsrochku i starat'sia svoego prava dlia "vtoruiu" (a po faktu pervuiu) otsrochku cherez prizyva v sudebnom poriadke.
Otsrochka ot armii po aspiranture: Esli Vy obuchaetes' soobrazno ochnoi forme obucheniia v obrazovatel'noi organizatsii sirech' nauchnoi organizatsii soobrazno imeiushchei gosudarstvennuiu akkreditatsiiu programme podgotovki nauchno-pedagogicheskikh kadrov v aspiranture (ad'iunkture), programme ordinatury libo programme assistentury-stazhirovki, - Vam obiazany predostavit' otsrochku cherez armii v promezhutok osvoeniia ukazannykh obrazovatel'nykh programm, no ne svyshe ustanovlennykh federal'nymi gosudarstvennymi obrazovatel'nymi standartami srokov polucheniia vysshego obrazovaniia - podgotovki kadrov vysshei kvalifikatsii, i dlia vremia zashchity kvalifikatsionnoi raboty (dissertatsii), odnako ne bolee odnogo vozrast vposledstvii zaversheniia obucheniia soobrazno sootvetstvuiushchei obrazovatel'noi programme vysshego obrazovaniia.
