Eta osvobodivshaiasia smelost' raskhoduetsia libo dlia ustroistvo fizicheskoi raboty, libo na nagrevanie. Kogda vyshli dopolnitel'noi fizicheskoi nagruzki, to chelovek v bukval'nom smysle dolzhen zakipet' cherez bystro osvobozhdaiushcheisia energii.
Nekotoryi sposoby obeshchaiut bystroe pokhudenie (0,5 kg v chislo i bolee). Eto veroiatno, tol'ko prisutstvie takoi skorosti nepremenno teriaetsia voda, razrushaetsia muskulatura, snizhaetsia funktsional'naia aktivnost' i ukhudshaetsia zdorov'e. Razrushenie myshts proiskhodit v rezul'tate adaptatsii organizma k nedostatochnomu postupleniiu belka s pishchei.
Osnovnaia naznachenie reguliatornykh sistem zakliuchaetsia v podderzhanii postoiannogo urovnia svobodnykh aminokislot (i drugikh nutrientov) v krovi. Ezheli iz kishechnika vsasyvaetsia nedostatochno amiinokislot, ikh uroven' v krovi nachinaet snizhat'sia. Daby vospolnit' nedostachu, ustroistvo razrushaet sobstvennye naimenee vazhnye belkovye tkani. V pervuiu ochered' takimi tkaniami iavliaiutsia myshtsy. Pomimo togo, nedostatochnoe postuplenie s pishchei uglevodov privodit k narusheniiu raboty mgnovenno vosproizvodiashchikhsia kletok (k takim tkaniam otnosiatsia vsia immunnaia poriadok, polovaia poriadok, epitelii zheludochno kishechnogo trakta). Nedostatochnoe chislo gliukozy v krovi ukhudshaet rabotu serdtsa, golovnogo mozga i drugikh zhiznenno vazhnykh organov. Soobrazno povodu takogo sposoba khudet' mezhdu spetsialistov bytuet nasmeshka: na <<bukhenval'dskoi>> diete khudeiut vse, odnako ne vse vyzhivaiut. Ne sleduet podvergat' sebia takim ispytaniiam.
Ustroistvo cheloveka vsegda prisposablivaet svoi metabolizm k usloviiam sushchestvovaniia i vybiraet naibolee optimal'nyi variant. Lishnii ves iavliaetsia rezul'tatom takogo prisposobleniia. Eto optimal'nyi variatsiia v slozhivshikhsia obstoiatel'stvakh. Esli ne uchityvat' osobennostei mekhanizmov adaptatsii, to peremena obraza zhizni mozhet soprovozhdat'sia ukhudsheniem zdorov'ia, snizheniem funktsional'noi aktivnosti i drugimi nepriiatnostiami.
Ogranichivat' sebia v upotreblenii prinosiashchikh utrata zdorov'iu produktov i  podstavliat' ikh na poleznye -- kardinal'nyi printsip kazhdoi diety. Tol'ko chashche tol'ko liudi pol'zuiutsia uzhe gotovymi dietami, gde ukazano kolichestvo i oblichie upotrebliaemoi pishchi, a takzhe era priioma takoi edy. Konechno, takoi podkhod namnogo udobnee, chem samomu sochiniat' algoritm pitaniia. Odnako ne sleduet vybirat' dlia sebia samye modnye i populiarnye diety. To, iz-za chego smogli toshchii znamenitosti, ne obiazatel'no smozhet pomoch' i vam. Vy takzhe dolzhny uchityvat' klimaticheskie kharakteristiki mesta prozhivaniia, vremia vozrast, chastnyi vozrast i osobennosti svoego organizma.
Opredelit'sia s voprosom <<kak pokhudet'>> vy dolzhny s cherez polnogo analiza svoego organizma, okruzhaiushchei sredy i natsional'nogo obraza pitaniia. Naprimer, ezheli vy khotite toshchii, ispol'zuia ekzoticheskuiu dietu, a vash zheludok vkonets ne ispytyval upotreblenie takoi pishchi prezhde, to mogut vozniknut' razlichnye problemy s pitaniem v dal'neishem. Vremia vozrast chtoby pokhudeniia takzhe imeet vazhnuiu rol', potomu skol'ko letom my privykli perekhvatit' svezhie frukty i ovoshchi, a zimoi my pitaemsia bol'she vsego zhirnoi i goriachei pishchei. Poetomu, okolo vybore diety nepremenno obrashchaite vnimanie na takie printsipy. V takom sluchae vam dovol'no namnogo legche podobrat' radi sebia put' pokhudeniia i vash organizm ne ispytaet tiazhiologo stressa.
