<p class="commentContent">
1. Nashe proshloe i nastoiashchee.

K. Marks schital, skol'ko chelovechestvo dolzhno veselo rasstavat'sia so svoim proshlym. Vprochem v zhizni vse proiskhodit s tochnost'iu prezhde naoborot. Obshchestvo razvivaetsia cherez apokalipsisy, i ne odna epokha ne ukhodit so stseny prezhde tekh por poka chelovechestvo ne obnaruzhit ves' ee merzkie priznaki zagnivaniia. Odnako dazhe potom etogo vdobavok nekotoryi desiatiletiia budut zhit' chelovek, s nostal'gicheskoi gorech'iu vspominaiushchie nevozvratnoe proshloe.

Tak bylo v starodavnie bibleiskie vremena, esli Moisei vodil svoe poroda 40 let po pustyne. Bez somneniia, nekotoryi vspominali o svoem proshlom v egipetskom rabstve podobno o blage, kogda khoziain byl zhestok, no vse zhe zabotilsia o propitanii svoikh rabov i krove dlia nikh. Teper' zhe rab, stav svobodnym, prinuzhden byl bolet' o svoem propitanii i krove samostoiatel'no.

Proshli tysiacheletiia, no chelovechestvo ne strashno izmenilos' v svoei osnove. Izza razrushennoi Berlinskoi stenoi ostalsia krovavyi stalinskii i zastoinyi brezhnevskii sotsializm. Tol'ko i nyne tysiachi liudei i ideologov prezhnikh poriadkov l'iut slezy, mechtaia vozvrashchat'sia v tu stranu, kotoroi uzhe perevelis' na karte mira.

I podobno by nam ne pytalis' dokazat', chto u sotsializma mozhet byt' i chelovecheskoe litso, nikto iz dobroporiadochnykh grazhdan v eto uzhe ne poverit. Kommunizm vrode vidy, tak i ostalsia neosoznannoi abstraktsiei. Edinstvennoe, chto ostalos' v pamiati, kotoryi tam nam obeshchali <<kazhdomu soobrazno potrebnosti, cherez kazhdogo po sposobnosti>>. Odnako kol' eto istinnaia namerenie, to chem ona besprichinno bystro otlichaetsia cherez potrebitel'skogo kapitalisticheskogo obshchestva. Bolee spravedlivymi raspredelitel'nymi otnosheniiami? Vozmozhno! No dlia praktike takoe delenie prevratilos' v uravnilovku na urovne blizkom k nishchete i pered strogim kontrolem chinovnikov. Byt' kapitalizme est' khot' vidimost' svobody. Sotsializm zhe ignoriruet dazhe etu vidimost'.

Poniatno, polozhenie usugubliaetsia tem, kotoryi i kapitalizm neprokhodimo dalek cherez raia na Zemle. Skoree, naoborot. Ego d'iavol'skie ob'iatiia burzhuaznykh svobod i bezuderzhnogo potrebleniia, togo i gliadi vvergnut mir v Geennu ognennuiu.

Krome nikoli konglomerat ne znalo takoi stepeni neravenstva. Odin barysh bogateev vladeet sobstvennost'iu ravnoi sovokupnoi sobstvennosti ostal'nykh 99% naseleniia Zemli. I eto eshche ne vecher. Ne proidet i chetverti veka, esli 90% bogatstva Zemli budut skontsentrirovany u 0,01% <<izbrannykh>>. Takovy tempy kontsentratsii i takova golod etikh <<izbrannikov>>.

Pravit' takoi sobstvennost'iu dozvolitel'no iskliuchitel'no s cherez privatizirovannykh imi zhe vlastnykh gosudarstvennykh struktur, nepomerno rastushchego chinovnichestva i iskusstvenno nagnetaemogo strakha, formiruemogo prodazhnymi SMI i eshche bolee prodazhnymi spetssluzhbami.

Uzhe segodnia liuboi zakonoposlushnyi meshchanin mozhet byt' <<ekstremistom>>, esli vyshel vyrazit' chastnyi protest na ulitsu, razve prinial uchastie v razoblachenii korruptsii, ezheli opublikoval v sotssetiakh prizyvy k soprotivleniiu vlast' i dazhe posle laiki i reposty. Banki, pridumav okonchatel'no nepravovoi slovo <<somnitel'naia gesheft>> naproch' perecherknulo nashe konstitutsionnoe monopoliia na prezumptsiiu nevinovnosti. Dlia osnovanii svoei boleznennoi mnitel'nosti oni arestovyvaiut imushchestvo grazhdan ot prodazhi nedvizhimosti, avtomobilei, tretiruiut malen'kii i palets biznes. Pri etom sushchestvuet kogorta <<neprikasaemykh>>, neobiazatel'no voruiushchikh milliardy dollarov.

Ukhodit v istoriiu to vek, kogda kapitalizm obespechival razvitie obshchestva radi schet stremleniia poluchit' pribyl'. My dazhe ostavim nemedlenno v storone zadacha, budto obrazovyvalas' eta pribyl'. Odnako sledovat' nei, chtoby by, stoiali bor'ba i tekhnicheskii obrazovanie, velichina obshchego blagosostoianiia liudei. Nyne edinoborstvo soglashat'sia ne na rynke, a sledovat' privilegiia upravliat' rynkami i kontrolirovat' ikh. Osnovnym sredstvom obogashcheniia stala dokhod -  monopol'naia, chinovnich'ia, prodazha razlichnykh prav, roialti, birzhevye puzyri na fondovom rynke i rynke nedvizhimosti, bankovskie protsenty po kreditam i nichem ne ogranichennye komissionnye nachisleniia, finansovye makhinatsii, iskusstvenno organizovannaia infliatsiia, deval'vatsiia i reval'vatsiia valiut, dostup k biudzhetnym subsidiiam i razlichnye <<raspily>> biudzhetnykh sredstv. Renta ne predpolagaet tekhnicheskogo progressa i rosta obshchego blagosostoianiia. Odnako eto prostoi chistoi vody grabezh!

Gde zhe vykhod? I upisyvat' li on?

Nastoiashchii luchshii sredstvo uznat' svoe budushchee - eto samim pobezhdat' i postroit' ego!

Radi nachala my opishem primer takogo budushchego. Korotko, no dovol'no radi togo, chtoby poniat', o chem idet rech'. A soglashat'sia ona o sozdanii kachestvenno novogo obshchestva. Izlozhenie idet o novoi sisteme chelovecheskikh otnoshenii.

Pereiti dlia sait http://maxpark.com/user/4295880651/content/6546358
</p>
