Sait otkrovennyi informatsionnyi resurs sotsial'nogo tipa, gde liuboi zhelaiushchii mozhet zaregistrirovat'sia i podelit'sia kakimi-libo ideiami i instruktsiiami v lichnom bloge. Materialy, stat'i i foto razmeshchaiutsia zaregistrirovannymi pol'zovateliami saita. Vlast' saita sledit za tem, chtoby publikatsii ne narushali Rossiiskoe zakonodatel'stvo i moral'no eticheskie normy.
Sait interesnykh samodelok, sdelannykh iz podruchnykh materialov i predmetov v domashnikh usloviiakh. Poshagovye master-klassy s foto i opisaniem, tekhnologii, primery rabot - postoianno, chto nuzhdat'sia dlia rukodeliia nastoiashchemu masteru inache prosto umel'tsu. Podelki liuboi slozhnosti, gromadnyi vybor napravlenii i idei chtoby tvorchestva.
My rady vas pozdravliat' v mire samodelok. U nas pozvolitel'no vyuchit' obrazovyvat' samomu  poleznye samodelki svoimi rukami, kotorye kachestvom ne budut ustupat' promyshlennym obraztsam vedushchikh firm.  Sei sait posviashchen vsem liubiteliam poleznykh samodelok, bud' to viazannaia marionetka, aviamodel', samodel'nyi radiopriemnik tozh liubaia drugaia nechto sdelannaia svoimi rukami. Vy mozhete priniat' pokrovitel'stvo v razvitii mira samodelok prislav svoiu samodelku nam na pochtu  libo edinovlastno opublikovat' samodelku zaregistrirovavshis' v mire samodelok.
sait dlia masterovitykh liudei. Zdes' umel'tsy mogut vykladyvat' primanka tvoreniia v raznom vide - sami idei, chertezhi, gotovye proekty, izobreteniia, voploshchennye svoimi rukami. Dlia saite mozhno uvidet' chestnye otzyvy ot liudei, kotorye vospol'zovalis' vashimi materialami, i takim obrazom poluchit' vsenarodnoe priznanie, v toi alias drugoi mere.
Dlia tekh, kto khochet, daby ikh unikal'nye samodelki uvideli drugie umel'tsy, i uznat' ikh otsenku, sait  iavliaetsia udobnym i dostupnym resheniem. Kogda vam nado publikovat' primanka raboty lish' chtoby sebia, voezhe nikto ikh bol'she ne uvidel - tutto sei sait ne chtoby vas.
