My odni iz pervoprokhodtsev na rynke magazinov iaponskoi kukhni formata take-away v Rossii. Etot unikal'nyi format byl razrabotan radi tekh sluchaev, esli khochetsia vkusno poobedat' inache pouzhinat', a dlia pokhod v restoran vyshli vremeni i deneg. My stali pervymi, kto sdelal bol'shie vkusnye iaponskie rolly dostupnymi kazhdomu.  Eto stalo vozmozhnym blagodaria bol'shim ob'emam prodazh seti i priamym postavkam produktov.
Segodnia zakazat' rolly iavliaetsia obychnoi i plotno voshedshei v nashu zhizn' privychkoi. Rolly -- skruchennye s cherez bambukovoi tsinovki ruletiki iz risa s razlichnoi nachinkoi, vposledstvii deliashchiesia na shest' ili vosem' dolek.
Na priznannyi moment, krome vsemirno izvestnykh rollov <<Filadel'fiia>> i <<Kaliforniia>> otdel'nyi iaponskii restoran imeet sobstvennoe eda ot shef-povara, kotoroe imeet unikal'nyi chislo, potomu i vybor takikh bliud ogromen.
Krome klassicheskikh kholodnykh, vrode <<Filadel'fii>> alias <<Ameriki>>, zakazat' rolly dlia khizhina mozhno i v razlichnykh variatsiiakh -- primerno, <<goriachie>> rolly -- zapechennye v kliare byt' vysokikh temperaturakh, idi sladkie frukty, vypolnennye iz razlichnykh osnov s fruktovymi nachinkami. Zakazat' rolly na khizhina libo v ofis -- izbavit' sebia ot chasov, potrachennykh dlia snariazhenie pishchi, speshno poluchit' polnotsennyi, poleznyi i vkusnyi uzhin.
Zakazat' rolly s dostavkoi tuda, gorazdo by vam bylo udobno -- seichas proshche prostogo. Dostatochno vybrat' iz obshirnogo spisok ponravivshiisia variatsiia i ispolniat' odin telefonnyi zvonok. Krome otdel'nykh portsii, Vy mozhete zakazat' rolly s besplatnoi dostavkoi v vide razlichnykh setov, voezhe ne upustit' ni odnogo vkusa!
Priglashaem uznavat' s nashim meniu, gde vy deistvitel'no naidete bliudo, kotoroe vam poliubitsia, a mnozhestvo aktsii i skidok pozvoliat s eshche bol'shei vygodoi priobresti priiatnyi uzhin.
Pomimo besplatnoi dostavki rollov dlia dom tozh v ofis, nasha kompaniia osushchestvliaet dostavku nigiri - sushi, a takzhe drugikh vidov sushi, gotovykh salatov v ofis i dlia dom (&quot;Tsezar'&quot;, &quot;Grecheskii&quot;, &quot;Chuka&quot;), shashlyka, pitstsy, goriachego plova, a takzhe drugikh bliud iaponskoi i kitaiskoi kukhni.
