Pomimo togo, pri okazanii kakoi-libo uslugi, Vy poluchite uvedomlenie na telefon sirech' elektronnuiu pochtu, o protsesse okazaniia uslugi. Drugimi slovami, Vy v real'nom vremeni budite otslezhivat' pogolovno protsess predostavleniia vam uslugi. Opredelennyi portal sozdan ne prostoi besprichinno i kem popalo. Ves' eto reguliruetsia gosudarstvom.
