Proshche govoria, portal gosuslug, to gorod, gde vy odin raz zaregistrirovalis' i poluchaete uslugi na vse gosudarstvennykh saitakh. I v dal'neishem, kakie by uslugi ne poiavlialis', vse oni budut poiavliat'sia dlia portale. Mne kazhetsia vel'mi udobno -- odinokii lozung chtoby vsekh vidov uslug.
