Nasha pervenstvo professional'nykh masterov zanimaetsia remontom i obsluzhivaniem okon (liubykh vidov) i montazhom svetoprozrachnykh konstruktsii na protiazhenii 9 ti let. Za eti gody my narabotali izobilie tysiach dovol'nykh klientov, kotorym my pomogli s ikh problemnymi oknami. Nashi okonnye mastera mogut spravit'sia s absoliutno vsiakii problemoi sviazannoi s oknami.
Uteplenie okon - nedorogoi i nachal'nyi manipuliatsiia ustranit' osnovnye prichiny proniknoveniia kholodnogo vozdukha v pomeshchenie. Kachestvennyi uteplitel' pozvolit sekonomit' imushchestvo dlia otoplenii doma, reshit problemu narusheniia teploizoliatsii i pozvolit otlozhit' dorogostoiashchii uluchshenie okna inache ego zamenu na nekotoroe vremia. Spetsialisty kompanii proizvedut uteplenie okon nedorogo, ispol'zuia noveishie tekhnologii i kachestvennye materialy.
Uteplenie dereviannykh okon po shvedskoi tekhnologii - optimal'nyi raznochtenie ustranit' poteriu tepla prisutstvie minimal'nykh denezhnykh  vlozheniiakh. Sekret metoda sostoit v montazhe spetsial'nogo uplotnitelia soobrazno vsemu perimetru okna, chto pozvoliaet polnost'iu likvidirovat' podduvanie v mestakh styka stekla i ramy. My ispol'zuem odin kachestvennye uplotniteli chtoby utepleniia dereviannykh okon, v osnove kotorykh silikonovyi i estestvennyi kauchuk.
Spetsialisty nashei kompanii imeiut obshchikh stazh raboty po ustanovke i remontu plastikovykh okon bolee 9  let i znaiut sovershenno tonkosti sborki okna, raboty furnitury, a tak zhe ikh osobennosti, znaiut iakoby pravil'no osushchestvliaetsia zamer i reguliarnyi montazh okon. Na nashikh skladakh naveki v nalichii naibolee khodovye komplektuiushchie radi okon, furnitura, uplotniteli, profili i d.r.  Ustranim liubuiu problemu v Vashem okne, ono dovol'no muchit'sia kak novost' ili dazhe luchshe.
</p>
