U vas slomalsia telefon razve vyshla iz stroia kakaia-to ego detal'? Ne bezdol'e! Dlia nashem saite vy naidiote vsio neobkhodimoe chtoby remonta mobil'nykh ustroistv. Kompaniia zanimaetsia prodazhei zapchastei k sotovym telefonam i smartfonam bol'shinstva izvestnykh marok i modelei.
U nas vovek v nalichii displei, tachskriny, akkumuliatory, korpusa, mikroskhemy, dinamiki, mikrofony i drugie zapasnye chasti k sotovym. Kupiv zapchast' v nashem internet-magazine, vam ostanetsia iskliuchitel'no obratit'sia v servisnyi sredotochie radi eio zameny v vashem gadzhete. A nekotorye detali dozvoleno legko pomeniat' samostoiatel'no. Okolo pravil'noi ekspluatatsii nash tovar prosluzhit vam vek i kachestvenno! My osushchestvliaem dostavku tovara v liubuiu tochku Rossii i SNG. Oplatit' zakaz vy mozhete liubym udobnym chtoby vas sposobom. V sluchae neispravnosti kuplennogo tovara vy mozhete vernut' detal' i poluchit' obratno den'gi.
Privetstvuiu vas na saite luchshego postavshchika zapchastei. Mne zavsegda nravilis' telefony i prochie gadzhety, s detstva ia chto-to razbiral i sobiral, poputno lomal i chinil. Odno iz liubimykh moikh zaniatii potom uchioby bylo poseshchenie salonov sviazi i izuchenie telefonov. Dal'novidnost' interneta eshchio ne bylo stol' glubokim, soglasen i vzhivuiu posmotret' ves' drugoe delo. Vdrug kak u menia poiavilis' pervye zarabotannye den'gi, ia togda zhe brosilsia iskat' mesto i vozmozhnosti otkryt' prinadlezhashchii salon sviazi. Eto byl 2007 god. Ne budu rasprostraniat' istoriiu na tri lista, eto otdel'naia soderzhanie, bylo izobilie vzliotov i padenii, esli kogo-to eto zainteresuet, rasskazhu istoriiu vo vsekh podrobnostiakh.
A teper' pereidem k suti. V 2013-14 u menia ostalsia odinoko bol'shoi salon sviazi i ogromnoe tsifra postoiannykh klientov. Oni-to i &quot;vynudili&quot; nachat' trudit'sia remontom telefonov. Mne otdel'nyi sutki prinosili izriadno ustroistv v magazin i prosili pomoch' s remontom. Tut ne bylo stol'ko masterskikh, vyezdnykh masterov, urokov na iut'iube, magazinov zapchastei i vsego togo, k chemu my teper' privykli. Daby vstrechat' instruktsiiu soobrazno razboru, vse poiskovye zaprosy vvodilis' agliiskimi slovami, tipa htc touch hd 2 batareia https://aksmob.ru/akkumuljatornaja-batareja-akb-dlja-htc-touch-hd2-t8585-1230ma.html Prostymi slovami, radi mnogikh moikh klientov ia okazalsia tem drugom, kto sharit v telefonakh. Sleduiushchie paru let my vyrosli v kozni salonov sviazi i servisnykh tsentrov. I dal'she proizoshlo to, skol'ko opisano vnachale stat'i pro pokroi displeev. My stolknuli s beskonechnymi vozvratami ustroistv iz-za defektnykh zapchastei, a besprichinno zhe s otsutstviem vozmozhnosti voznagrazhdat' ikh liubomu iz postavshchikov v Rossii.
Nasha kompaniia chinit budto 10000 telefonov v god, skol'ko vynuzhdaet derzhat' svoi sklad zapchastei, a ob'emy i ispytanie pozvoliaiut zakupat' neuklonno s fabrik, tol'ko krug obiazan zanimat'sia svoim delom, sledovatel'no my prodolzhitel'no i muchitel'no pytalis' soglashat'sia s osnovnymi magazinami zapchastei. Libo my plokho ob'iasniali, libo nas ne slushali, tol'ko dogovorit'sia ni s kem ne poluchilos' i spasibo im izza eto. V etot moment i rodilas' poniatie razdelit' kompaniiu na 2 chasti i sluchat'sia tem samym postavshchikom zapchastei, kotorogo my tak protiazhno iskali.
Bol'she vozrast my testirovali rabotu s druzhestvennymi nam masterskimi, postavliali im zapchasti, sobirali otzyvy, otrabatyvali postavki. V 2016 godu my otkryli dostup k nashemu skladu s cherez internet-magazina. My khorosho rabotali i nyne u nas kipa druzei po vsei Rossii, a besprichinno zhe osobennyi raspredelitel'nyi ustroistvo zapchastei v Kitae.
Radi schet nashikh partnerskikh otnoshenii so mnogimi vedushchimi proizvoditeliami i ofitsial'nymi distrib'iutorami, my mozhem predlozhit' chtoby nashikh klientov samye dostupnye tseny na razlichnye zapchasti i komplektuiushchie.
</p>
